Introducing Kavya ♥️🪬✨

“Shot this film last year in Delhi, and finally got to watch it, thanks to the @goldenjury 

In my career, I’ve had the privilege of working with some of the most experienced people in the film industry, but this set was entirely different — the youngest, coolest, and most chill crew ever. It felt like a group of passionate kids coming together to create something special.

A big thanks to @iamshubhs @firstclapmotionpictures and @shreyansh.pratihar for trusting me and making this project so adaptable.

@styledbykhushii @gaurav_khetterpal @pallavisinghh @simrandhaliwal9 @tanish_kalshyan Ashish, Shradha, Ankita and the entire team — you’ve all made this film truly shine. I’m so proud of what we’ve created together!”

